"   <div id=\"basicsTopicLeft\">",
"    <div id=\"topicTitle\">",
"     Patient information: Bedbugs (The Basics)",
"    </div>",
"    <span class=\"view\">",
"     View in",
"     <a class=\"lang\" href=\"./es-419/bedbugs-the-basics?source=topic_page\">",
"      Spanish",
"     </a>",
"    </span>",
"    <a class=\"contributor contributor_credentials\" href=\"./authors-and-editors/patient-information\">",
"     Written by the doctors and editors at UpToDate",
"    </a>",
"    <div id=\"topicText\">",
"     <p class=\"headingAnchor\" id=\"H46118747\">",
"      <span class=\"h1\">",
"       What are bedbugs?",
"      </span>",
"      &nbsp;&mdash;&nbsp;Bedbugs are tiny bugs that do not fly (",
"      <a class=\"graphic graphic_picture graphicRef66540 \" href=\"mobipreview.htm?20/1/20500\">",
"       picture 1",
"      </a>",
"      ). They are found all over the world. Bedbugs can live in hotels, houses, and other places where people rest and sleep. They can live in your mattress, your clothes, the walls, and other parts of your house. Most often, they bite you while you are sleeping or resting.",
"     </p>",
"     <p>",
"      If you have bedbugs in your home, you may not be able to see them. They are very small and hide during the day.",
"     </p>",
"     <p>",
"      Bedbugs do not spread diseases in people.",
"     </p>",
"     <p class=\"headingAnchor\" id=\"H46118754\">",
"      <span class=\"h1\">",
"       What do bedbug bites look like?",
"      </span>",
"      &nbsp;&mdash;&nbsp;Bedbug bites are small, red and swollen areas of the skin that are often:",
"     </p>",
"     <p>",
"      <ul class=\"bulletCompact-block\">",
"       <li>",
"        In a row or a line",
"       </li>",
"       <li>",
"        On parts of the body not usually covered by clothes, such as the face, neck, arms, and hands",
"       </li>",
"       <li>",
"        Very itchy",
"       </li>",
"      </ul>",
"     </p>",
"     <p>",
"      Most people don&rsquo;t feel it when they get bitten. They may notice the bites in the morning or after a day or two. Bedbug bites can take 3 to 6 weeks to heal. They can get infected if you scratch them a lot.",
"     </p>",
"     <p class=\"headingAnchor\" id=\"H46118761\">",
"      <span class=\"h1\">",
"       Is there a test to tell if I have bedbug bites?",
"      </span>",
"      &nbsp;&mdash;&nbsp;No. There is no test. But your doctor or nurse may suspect that your bites are from bedbugs when he or she looks at your skin. Other types of bugs and some diseases can also cause red bumps on the skin that look like bedbug bites.",
"     </p>",
"     <p>",
"      The only way to know for sure if you have bedbugs in your home is to catch one. Experts can then inspect the insect. They can tell if it is a bedbug or another type of bug.",
"     </p>",
"     <p class=\"headingAnchor\" id=\"H46118768\">",
"      <span class=\"h1\">",
"       Is there anything I can do on my own to help my bites feel better?",
"      </span>",
"      &nbsp;&mdash;&nbsp;Yes. To help your bites feel better and heal faster, you can:",
"     </p>",
"     <p>",
"      <ul class=\"bulletCompact-block\">",
"       <li>",
"        Keep the skin clean and dry",
"       </li>",
"       <li>",
"        Try not to scratch the bites",
"       </li>",
"       <li>",
"        Use an anti-itch lotion or cream to help with the itching",
"       </li>",
"      </ul>",
"     </p>",
"     <p class=\"headingAnchor\" id=\"H46118775\">",
"      <span class=\"h1\">",
"       Should I see a doctor or nurse?",
"      </span>",
"      &nbsp;&mdash;&nbsp;See your doctor or nurse right away if the bites:",
"     </p>",
"     <p>",
"      <ul class=\"bulletCompact-block\">",
"       <li>",
"        Get redder",
"       </li>",
"       <li>",
"        Get more swollen",
"       </li>",
"       <li>",
"        Start having pus come out of them",
"       </li>",
"      </ul>",
"     </p>",
"     <p>",
"      If any of these things happen, your bites may be infected. Your doctor or nurse may prescribe a special medicine to put on your bites.",
"     </p>",
"     <p>",
"      When you first find out you have bedbugs in your home, you may feel very worried or upset. If you feel this way, talk to your doctor about what you can do.",
"     </p>",
"     <p class=\"headingAnchor\" id=\"H46118782\">",
"      <span class=\"h1\">",
"       What should I do about the bedbugs in my home?",
"      </span>",
"      &nbsp;&mdash;&nbsp;You will need to get rid of the bedbugs in your home so you do not get any more bites. To start, you can:",
"     </p>",
"     <p>",
"      <ul class=\"bulletCompact-block\">",
"       <li>",
"        Vacuum your home",
"       </li>",
"       <li>",
"        Wash your clothes and bedding, and dry them in a dryer that is on the hottest setting",
"       </li>",
"       <li>",
"        Clean up your home",
"       </li>",
"      </ul>",
"     </p>",
"     <p>",
"      Then, you or your landlord should call a pest control service. The workers might use a chemical in your home to get rid of the bedbugs. You should not try to use any chemicals yourself.",
"     </p>",
"     <p>",
"      If you want to get rid of some of your clothes or things, do not give them to other people. The bedbugs could still be in them. You do not want to spread bedbugs to other people.",
"     </p>",
"     <p class=\"headingAnchor\" id=\"H46118789\">",
"      <span class=\"h1\">",
"       Can bedbug bites be prevented?",
"      </span>",
"      &nbsp;&mdash;&nbsp;The only way to prevent bites is by getting rid of the bedbugs. Also, do not sleep or stay over in a place that you know has bedbugs.",
"     </p>",
"     <p class=\"headingAnchor\" id=\"H46118894\">",
"      <span class=\"h1\">",
"       More on this topic",
"      </span>",
"     </p>",
"     <p>",
"      <a class=\"medical medical_patient\" href=\"mobipreview.htm?14/30/14817?source=see_link\">",
"       Patient information: Bedbugs (Beyond the Basics)",
"      </a>",
"     </p>",
