" <div id=\"topicContent\">",
"  <div id=\"topicTitle\">",
"   Primary lung graft dysfunction",
"  </div>",
"  <div id=\"topicContributors\">",
"   <div>",
"    <a id=\"authors\">",
"    </a>",
"    <a class=\"contributor contributor_credentials contributorType\" href=\"mobipreview.htm?35/13/36057/contributors\">",
"     Authors",
"    </a>",
"    <br/>",
"    <a class=\"contributor contributor_credentials\" href=\"mobipreview.htm?35/13/36057/contributors\">",
"     Marcelo Cypel, MD",
"    </a>",
"    <br/>",
"    <a class=\"contributor contributor_credentials\" href=\"mobipreview.htm?35/13/36057/contributors\">",
"     Tom Waddell, MD",
"    </a>",
"    <br/>",
"    <a class=\"contributor contributor_credentials\" href=\"mobipreview.htm?35/13/36057/contributors\">",
"     Shaf Keshavjee, MD, MSc, FRCSC, FACS",
"    </a>",
"    <br/>",
"   </div>",
"   <div>",
"    <a class=\"contributor contributor_credentials contributorType\" href=\"mobipreview.htm?35/13/36057/contributors\">",
"     Section Editor",
"    </a>",
"    <br/>",
"    <a class=\"contributor contributor_credentials\" href=\"mobipreview.htm?35/13/36057/contributors\">",
"     Elbert P Trulock, MD",
"    </a>",
"    <br/>",
"   </div>",
