"    <a class=\"contributor contributor_credentials contributorType\" href=\"mobipreview.htm?35/13/36058/contributors\">",
"     Section Editors",
"    </a>",
"    <br/>",
"    <a class=\"contributor contributor_credentials\" href=\"mobipreview.htm?35/13/36058/contributors\">",
"     Joseph Chorley, MD",
"    </a>",
"    <br/>",
"    <a class=\"contributor contributor_credentials\" href=\"mobipreview.htm?35/13/36058/contributors\">",
"     John K Triedman, MD",
"    </a>",
"    <br/>",
"   </div>",
"   <div>",
