var title_f35_13_36059="Potass iodide radiation expos";
var content_f35_13_36059=[" <div id=\"graphicsToolbar\">",
"  <div id=\"graphicsCopy\">",
"   &copy;2013 UpToDate",
"   <sup>",
"    &reg;",
"   </sup>",
"  </div>",
"  <div id=\"graphicsLinks\">",
"   <a href=\"?imageKey=HEME%2F69996&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=5\" onclick=\"\">",
"    <img alt=\"Print this page\" src=\"./../images/icn_print.myextg\" title=\"Print this page\"/>",
"   </a>",
"   <a class=\"icontxt textLink\" href=\"?imageKey=HEME%2F69996&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=5\" onclick=\"\" title=\"Print this page\">",
"    Print",
"   </a>",
"   <a class=\"etacLink\" href=\"#\">",
"    <img alt=\"Email graphic(s)\" src=\"./../images/icn_email.myextg\" title=\"Email graphic(s)\"/>",
"   </a>",
"   <a class=\"icontxt textLink etacLink\" href=\"#\" title=\"Email graphic(s)\">",
"    Email",
"   </a>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\">",
"   <div class=\"ttl\">",
"    Recommended doses of potassium iodide after radiation exposure",
"   </div>",
"   <div class=\"cntnt\">",
"    <table cellspacing=\"0\">",
"     <tbody>",
"      <tr>",
"       <td class=\"subtitle1\" colspan=\"1\">",
"        Age of",
"patient",
"       </td>",
"       <td class=\"subtitle1\">",
"        Predicted thyroid dose (cGy)",
"       </td>",
"       <td class=\"subtitle1\">",
"        Daily dose of KI (mg)*",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        &gt;40 years",
"       </td>",
"       <td>",
"        &ge;",
"500",
"       </td>",
"       <td>",
"        130",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        &gt;18 through 40",
"       </td>",
"       <td>",
"        &ge; 10",
"       </td>",
"       <td>",
"        130",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Pregnant or",
"lactating",
"       </td>",
"       <td>",
"        &ge; 5",
"       </td>",
"       <td>",
"        130",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        &gt;12 though 18 years",
"       </td>",
"       <td>",
"        &ge; 5",
"       </td>",
"       <td>",
"        65",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        &gt;3 through 12 years",
"       </td>",
"       <td>",
"        &ge; 5",
"       </td>",
"       <td>",
"        65",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        &gt;1 month through 3 years",
"       </td>",
"       <td>",
"        &ge; 5",
"       </td>",
"       <td>",
"        32",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Birth through 1 month",
"       </td>",
"       <td>",
"        &ge; 5",
"       </td>",
"       <td>",
"        16",
"       </td>",
"      </tr>",
"     </tbody>",
"    </table>",
"   </div>",
"   <div class=\"lgnd\">",
"    <div class=\"footnotes\">",
"     KI: potassium iodide.",
"     <br>",
"      * Potassium iodide is available as 130 or 65 mg tablets, or as Lugol's solution. KI must be used within 4 to 6 hours of exposure to block uptake of radioactive iodine by the thyroid. If radioactive iodines are not part of the radiation exposure, KI is not needed. See text for details.",
"     </br>",
"    </div>",
"    <div class=\"reference\">",
"     Based on FDA Guidance, 2001. Available at &lt;www.fda.gov/cder/guidance/4825fnl.htm&gt;.",
"    </div>",
"   </div>",
"  </div>",
" </div>",
"</div>"].join("\n");
