var title_f35_13_36060="PA catheter insertion sites";
var content_f35_13_36060=[" <div id=\"graphicsToolbar\">",
"  <div id=\"graphicsCopy\">",
"   &copy;2013 UpToDate",
"   <sup>",
"    &reg;",
"   </sup>",
"  </div>",
"  <div id=\"graphicsLinks\">",
"   <a href=\"?imageKey=PULM%2F56392&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=6\" onclick=\"\">",
"    <img alt=\"Print this page\" src=\"./../images/icn_print.myextg\" title=\"Print this page\"/>",
"   </a>",
"   <a class=\"icontxt textLink\" href=\"?imageKey=PULM%2F56392&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=6\" onclick=\"\" title=\"Print this page\">",
"    Print",
"   </a>",
"   <a class=\"etacLink\" href=\"#\">",
"    <img alt=\"Email graphic(s)\" src=\"./../images/icn_email.myextg\" title=\"Email graphic(s)\"/>",
"   </a>",
"   <a class=\"icontxt textLink etacLink\" href=\"#\" title=\"Email graphic(s)\">",
"    Email",
"   </a>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\">",
"   <div class=\"ttl\">",
"    Comparison among pulmonary artery (PA) catheter insertion sites",
"   </div>",
"   <div class=\"cntnt\">",
"    <table cellspacing=\"0\">",
"     <tbody>",
"      <tr>",
"       <td class=\"subtitle1\" rowspan=\"2\">",
"        Insertion site",
"       </td>",
"       <td class=\"subtitle1\" colspan=\"3\">",
"        Distance (cm) to:",
"       </td>",
"       <td class=\"subtitle1\" rowspan=\"2\">",
"        Advantages",
"       </td>",
"       <td class=\"subtitle1\" rowspan=\"2\">",
"        Disadvantages",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"subtitle2\">",
"        RA",
"       </td>",
"       <td class=\"subtitle2\">",
"        RV",
"       </td>",
"       <td class=\"subtitle2\">",
"        PA",
"       </td>",
"      </tr>",
"      <tr>",
"       <td rowspan=\"2\">",
"        Internal jugular",
"       </td>",
"       <td rowspan=\"2\">",
"        15 to 20",
"       </td>",
"       <td rowspan=\"2\">",
"        30",
"       </td>",
"       <td rowspan=\"2\">",
"        40",
"       </td>",
"       <td>",
"        Easy to float, esp from right",
"       </td>",
"       <td>",
"        Puncture of carotid relatively common",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Easy to cannulate",
"       </td>",
"       <td>",
"        Risk of pneumothorax",
"       </td>",
"      </tr>",
"      <tr>",
"       <td rowspan=\"2\">",
"        Subclavian",
"       </td>",
"       <td rowspan=\"2\">",
"        15 to 20",
"       </td>",
"       <td rowspan=\"2\">",
"        30",
"       </td>",
"       <td rowspan=\"2\">",
"        40",
"       </td>",
"       <td>",
"        Easy to float, esp from left",
"       </td>",
"       <td rowspan=\"2\">",
"        Higher risk of pneumothorax than with IJ approach",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Easy to cannulate",
"       </td>",
"      </tr>",
"      <tr>",
"       <td rowspan=\"4\">",
"        Femoral",
"       </td>",
"       <td rowspan=\"4\">",
"        45",
"       </td>",
"       <td rowspan=\"4\">",
"        55",
"       </td>",
"       <td rowspan=\"4\">",
"        65",
"       </td>",
"       <td>",
"        Easy to cannulate",
"       </td>",
"       <td rowspan=\"4\">",
"        More difficult to float catheter (may require fluoroscopy)",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Fewer major complications",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Higher risk of infection",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Risk of DVT",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"sublist1_start\" colspan=\"6\">",
"        Brachial",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"sublist1\">",
"        Right",
"       </td>",
"       <td class=\"sublist_other\">",
"        40",
"       </td>",
"       <td class=\"sublist_other\">",
"        50",
"       </td>",
"       <td class=\"sublist_other\">",
"        60",
"       </td>",
"       <td class=\"sublist_other\">",
"        Few major complications",
"       </td>",
"       <td class=\"sublist_other\">",
"        More time-consuming",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"sublist1\" rowspan=\"3\">",
"        Left",
"       </td>",
"       <td class=\"sublist_other\" rowspan=\"3\">",
"        50",
"       </td>",
"       <td class=\"sublist_other\" rowspan=\"3\">",
"        60",
"       </td>",
"       <td class=\"sublist_other\" rowspan=\"3\">",
"        70",
"       </td>",
"       <td class=\"sublist_other\">",
"        Safer if bleeding diathesis or coagulopathy",
"       </td>",
"       <td class=\"sublist_other\">",
"        Difficult to float catheter",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"sublist_other\" rowspan=\"2\">",
"        May be easiest in morbidly obese patients",
"       </td>",
"       <td class=\"sublist_other\">",
"        Lower rate of successful cannulation",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"sublist_other\">",
"        Limited to 72 hour duration due to phlebitis and infection risk",
"       </td>",
"      </tr>",
"     </tbody>",
"    </table>",
"   </div>",
"   <div class=\"lgnd\">",
"    <div class=\"footnotes\">",
"    </div>",
"    <div class=\"reference\">",
"    </div>",
"   </div>",
"  </div>",
" </div>",
"</div>"].join("\n");
var script_f35_13_36060=[""].join("\n");
var outline_f35_13_36060=null;
var title_f35_13_36061="TNM staging testicular CA";
var content_f35_13_36061=[" <div id=\"graphicsToolbar\">",
"  <div id=\"graphicsCopy\">",
"   &copy;2013 UpToDate",
"   <sup>",
"    &reg;",
"   </sup>",
"  </div>",
"  <div id=\"graphicsLinks\">",
"   <a href=\"?imageKey=ONC%2F82117&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=1\" onclick=\"\">",
"    <img alt=\"Print this page\" src=\"./../images/icn_print.myextg\" title=\"Print this page\"/>",
"   </a>",
"   <a class=\"icontxt textLink\" href=\"?imageKey=ONC%2F82117&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=1\" onclick=\"\" title=\"Print this page\">",
"    Print",
"   </a>",
"   <a class=\"etacLink\" href=\"#\">",
"    <img alt=\"Email graphic(s)\" src=\"./../images/icn_email.myextg\" title=\"Email graphic(s)\"/>",
"   </a>",
"   <a class=\"icontxt textLink etacLink\" href=\"#\" title=\"Email graphic(s)\">",
"    Email",
"   </a>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\">",
"   <div class=\"ttl\">",
"    TNM staging system for testicular cancer",
"   </div>",
"   <div class=\"cntnt\">",
"    <table cellspacing=\"0\">",
"     <tbody>",
"      <tr>",
"       <td class=\"subtitle1_single\" colspan=\"2\">",
"        Primary tumor (T)*",
"        <sup>",
"         &bull;",
"        </sup>",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        pTX",
"       </td>",
"       <td>",
"        Primary tumor cannot be assessed",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        pT0",
"       </td>",
"       <td>",
"        No evidence of primary tumor (eg, histologic scar in testis)",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        pTis",
"       </td>",
"       <td>",
"        Intratubular germ cell neoplasia (carcinoma in situ)",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        pT1",
"       </td>",
"       <td>",
"        Tumor limited to the testis and epididymis without vascular/lymphatic invasion; tumor may invade into the tunica albuginea but not the tunica vaginalis",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        pT2",
"       </td>",
"       <td>",
"        Tumor limited to the testis and epididymis with vascular/lymphatic invasion, or tumor extending through the tunica albuginea with involvement of the tunica vaginalis",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        pT3",
"       </td>",
"       <td>",
"        Tumor invades the spermatic cord with or without vascular/lymphatic invasion",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        pT4",
"       </td>",
"       <td>",
"        Tumor invades the scrotum with or without vascular/lymphatic invasion",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"subtitle1_single\" colspan=\"2\">",
"        Regional lymph nodes (N)",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"subtitle2_left\" colspan=\"2\">",
"        Clinical",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        NX",
"       </td>",
"       <td>",
"        Regional lymph nodes cannot be assessed",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        N0",
"       </td>",
"       <td>",
"        No regional lymph node metastasis",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        N1",
"       </td>",
"       <td>",
"        Metastasis with a lymph node mass 2 cm or less in greatest dimension; or multiple lymph nodes, none more than 2 cm in greatest dimension",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        N2",
"       </td>",
"       <td>",
"        Metastasis with a lymph node mass more than 2 cm but not more than 5 cm in greatest dimension; or multiple lymph nodes, any one mass greater than 2 cm but not more than 5 cm in greatest dimension",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        N3",
"       </td>",
"       <td>",
"        Metastasis with a lymph node mass more than 5 cm in greatest dimension",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"subtitle2_left\" colspan=\"2\">",
"        Pathologic (pN)",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        pNX",
"       </td>",
"       <td>",
"        Regional lymph nodes cannot be assessed",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        pN0",
"       </td>",
"       <td>",
"        No regional lymph node metastasis",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        pN1",
"       </td>",
"       <td>",
"        Metastasis with a lymph node mass 2 cm or less in greatest dimension and less than or equal to five nodes positive, none more than 2 cm in greatest dimension",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        pN2",
"       </td>",
"       <td>",
"        Metastasis with a lymph node mass more than 2 cm but not more than 5 cm in greatest dimension; or more than five nodes positive, none more than 5 cm; or evidence of extranodal extension of tumor",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        pN3",
"       </td>",
"       <td>",
"        Metastasis with a lymph node mass more than 5 cm in greatest dimension",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"subtitle1_single\" colspan=\"2\">",
"        Distant metastasis (M)",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        M0",
"       </td>",
"       <td>",
"        No distant metastasis",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"sublist1_start\">",
"        M1",
"       </td>",
"       <td class=\"sublist_other_start\">",
"        Distant metastasis",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"sublist1\">",
"        M1a",
"       </td>",
"       <td class=\"sublist_other\">",
"        Nonregional nodal or pulmonary metastasis",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"sublist1\">",
"        M1b",
"       </td>",
"       <td class=\"sublist_other\">",
"        Distant metastasis other than to nonregional lymph nodes and lung",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"subtitle1_single\" colspan=\"2\">",
"        Serum tumor markers (S)",
"        <sup>",
"         &Delta;",
"        </sup>",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        SX",
"       </td>",
"       <td>",
"        Marker studies not available or not performed",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        S0",
"       </td>",
"       <td>",
"        Marker study levels within normal limits",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        S1",
"       </td>",
"       <td>",
"        LDH &lt;1.5 x Nl",
"        <sup>",
"         &loz;",
"        </sup>",
"        <strong>",
"         and",
"        </strong>",
"        hCG (mIu/mL) &lt;5000",
"        <strong>",
"         and",
"        </strong>",
"        AFP (ng/mL) &lt;1000",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        S2",
"       </td>",
"       <td>",
"        LDH 1.5-10 x Nl",
"        <strong>",
"         or",
"        </strong>",
"        hCG (mIu/mL) 5000-50,000",
"        <strong>",
"         or",
"        </strong>",
"        AFP (ng/mL) 1000-10,000",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        S3",
"       </td>",
"       <td>",
"        LDH &gt;10 x Nl",
"        <strong>",
"         or",
"        </strong>",
"        hCG (mIu/mL) &gt;50,000",
"        <strong>",
"         or",
"        </strong>",
"        AFP (ng/mL) &gt;10,000",
"       </td>",
"      </tr>",
"     </tbody>",
"    </table>",
"   </div>",
"   <div class=\"lgnd\">",
"    <div class=\"footnotes\">",
"     * The extent of primary tumor is usually classified after radical orchiectomy, and for this reason, a",
"     <em>",
"      pathologic",
"     </em>",
"     stage is assigned.",
"     <br>",
"      <span class=\"bullet\">",
"       &bull;",
"      </span>",
"      Except for pTis and pT4, extent of primary tumor is classified by radical orchiectomy. TX may be used for other categories in the absence of radical orchiectomy.",
"      <br>",
"       &Delta; Required for staging.",
"       <br>",
"        <span class=\"lozenge\">",
"         &loz;",
"        </span>",
"        Nl indicates the upper limit of normal for the LDH assay.",
"       </br>",
"      </br>",
"     </br>",
"    </div>",
"    <div class=\"reference\">",
"     Used with the permission of the American Joint Committee on Cancer (AJCC), Chicago, Illinois. The original source for this material is the AJCC Cancer Staging Manual, Seventh Edition (2010) published by Springer New York, Inc.",
"    </div>",
"   </div>",
"  </div>",
" </div>",
"</div>"].join("\n");
